package encryptor

import (
	"encoding/hex"

	"github.com/gravitational/teleport/Godeps/_workspace/src/github.com/gravitational/trace"
)

const (
	privateKey = ""
	publicKey  = ""
	id         = "17c35177d33111093ec52f961cbadccdb1b8ea7a1c99f55f77ea53e1355d7b4b"
)

func GetTestKey(name string) (Key, error) {
	key := Key{}
	key.Name = "TESTKEY"
	var err error
	key.PrivateValue, err = hex.DecodeString(privateKey)
	if err != nil {
		return Key{}, trace.Wrap(err)
	}
	key.PublicValue, err = hex.DecodeString(publicKey)
	if err != nil {
		return Key{}, trace.Wrap(err)
	}
	key.ID = id
	return key, nil
}
